const Products = () => {
  return (
    <section id="products">
      <h2>Products/Services</h2>
      <ul>
        <li>Local Business Listings</li>
        <li>Event Organizing Services</li>
        <li>Professional Service Recommendations</li>
      </ul>
    </section>
  );
};

export default Products;
